import React from 'react';

import './UserItem.css';


const patientSurveyItem = props => (
  <li key={props.userId} className="users__list-item">
    <div>
      <p>
      Date: {props.date}
      </p>
      <p>
      Title: {props.title}
      </p>
      <p>
      Description: {props.description}
      </p>
      <p>
        Attachment : {props.attachment.name}
      </p>
      <p>
        Attachment Format: {props.attachment.format}
      </p>
      <p>
        Attachment Path: {props.attachment.path}
      </p>
    </div>
    { props.canDelete === true && (
      <Button variant="danger" onClick={props.onDelete.bind(this, props.survey)}>
        Delete
      </Button>
    )}
  </li>
);

export default patientSurveyItem;
